import React from "react";

function Cart(props) {


  return (
    <div className="col-md-4 col-sm-6">
      <div className="card">
        <div className="card-header">
          <img
            className=" img-thumbnail "
            src={props.info.img}
            style={{ maxWidth: "100%" }}
            alt="profile pictur  "
          />
        </div>
        <div className="card-body">
          <div>
            <h3>{props.info.name}</h3>{" "}
          </div>
          <div>         
            <h4> {props.info.email}</h4>
          </div>
          <div>       
            <h4> {props.info.phone}</h4>
          </div>
        </div>
      </div>
    </div>
  );
}
export default Cart;
